More than 2 MILLION downloads in Brazil!
GPS Brasil is the GPS navigation app developed by NDrive, that guides you wherever you want, easily and quickly.

This app is FREE and includes Brazil map, SAFETY CAMERAS database and LIVE TRAFFIC information to find you the best routes available.

With GPS Brasil you can navigate offline without any data consumption. No need to worry about your phone bill. Just navigate!

You can also use GPS Brasil to search among the thousands of POIs (Points-of-Interest) available and displayed in the map and find NEARBY places, thanks to the included Foursquare database.

GPS Brasil takes you everywhere. Download! Use It! Spread the word!
______________________________________________________________________
BENEFITS:
- FREE navigation app with all features, including Brazil map.
- FREE Live* traffic information.
- Safety cameras database.
- Access to the latest map updates.
- Free Updates: Maps, Traffic info and POI
______________________________________________________________________
MAIN FEATURES:

- Instant speed directly on screen;
- Voice Search;
- Share ETA (estimated time of arrival);
- TTS (text-to-speech) - voice instructions including spoken street names and exit numbers;
- Routes change according to current traffic conditions;
- Choose your next restaurant, check prices and reviews and make a reservation before navigating;
- Choose from several routing alternatives, before starting navigation;
- 3D buildings;
- Lane assistance for complex exit ramps;
- Find a parking spot as soon as you arrive at your destination;
- Navigate to a contact address stored on your phone;
- Pedestrian mode;
_______________________________________
Please note the following:

• The first time you run the app, please connect your phone to a stable Wi-Fi network, so that you’re able to download your map right away.
• Never let the navigation instructions interfere with your driving.
• When using GPS Brasil while driving, never hold your phone on your hands. Place it on a standard holder, with a clear sky view.
• Allowing GPS to run in the background for extended periods can lead to a significant reduction in battery life.

*this feature requires internet access; cellular data charges may apply.

Carona Car, pede uma Carona!

Carona Car é um aplicativo criado para inovar no mercado de mobilidade. Com o Carona Car você solicita viagens rápidas com segurança e muitos atrativos para quem se transporta conosco, além de diversos pacotes de serviços para motoristas. Você chega ao seu destino com segurança, conforto e pagando um preço justo.

Além disso, para facilitar ainda mais sua vida, com O Carona Car é possível realizar deslocamento municipal, intermunicipal e serviços corporativos .

O pagamento é fácil, rápido e pode ser feito com cartão de crédito (pelo aplicativo), em dinheiro ou com cartão de credito ou debito direto com o motorista.

Baixe o App e faça sua primeira viagem hoje mesmo nas cidades que já possuem o aplicativo.

Veja como funciona:

- Abra o App e informe seu destino;

- O app utiliza sua localização para que o motorista saiba onde encontrar você;

- Você recebe a foto do motorista e os dados do veículo, além de poder acompanhar a chegada no mapa;

- O pagamento pode ser feito com cartão de crédito pelo aplicativo, dinheiro ou cartão de débito ou crédito direto com o motorista.;

- Depois da viagem, você pode avaliar seu motorista e nos enviar seus comentários para que possamos melhorar a experiência com o Carona Car. Você receberá seu recibo por e-mail, com todas as informações da viagem.

Quer uma forma rápida e fácil de se locomover? Solicite sua viagem no App Carona Car.

The Park Indigo BR app allows you to register and manage all your parking needs:
- Sign Up and create an account;
- Find your favorite Indigo car park;
- Use the app to scan your parking ticket and pay.  No more queuing at a paystation!;
- Select a location and click on the address to get directions using mapping;
- Add Vehicles or cards to your account;
- View all your current, upcoming or past parking activity.

Foi desenvolvido pelo BRB para proporcionar uma melhor experiência aos usuários do Transporte Público do Distrito Federal.

Ao se cadastrar no app, você tem acesso aos seus cartões de mobilidade e passa a contar com facilidades que antes estavam disponíveis somente em atendimento presencial nos postos do BRB Mobilidade, tais como:
•             Realização de recarga por meio de boleto;
•             Consulta de saldo e extrato de uso do cartão;
•             Acesso ao Chatbot para tirar dúvidas e/ou solicitar serviços, com interação humana;
•             Acesso aos itinerários dos ônibus.

Ao longo do tempo, o BRB tem investido em melhorias contínuas e na segurança do app, com foco na experiência dos nossos clientes. Como por exemplo, a inclusão de foto durante o cadastro e o login, que passou a exigir o e-mail e a senha cadastrados para acessar os dados do cartão.

Você ainda não possui o cartão mobilidade?

Faça o seu cadastro no App e depois compareça em qualquer um dos postos do BRB Mobilidade para receber gratuitamente a sua primeira via.

Baixe-o agora e tenha disponível na palma de sua mão as funcionalidades e serviços que irão facilitar o seu trajeto.
